import React from 'react';
import 'isomorphic-unfetch';
import 'bootstrap/dist/css/bootstrap.min.css';
import Form from '../src/components/Form/Form';
function Login() {
  return (
    <div className="container-fluid">
      <Form />
    </div>
  );
}
export default Login;
